    [],nt"num_tags": 6,nt"name": "tewaukon-national-wildlife-refuge-annual-narrative-report-calendar-year-1989",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Tewaukon
    NWR and Tewaukon WMD outlines Refuge accomplishments during the 1989 calendar year.
    The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning, public participation, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, croplands, grasslands, grazing, haying,
    fire management, pest control, water rights, wilderness areas, and WPA easements.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, raptors, game mammals,
    fisheries resources, animal control, and disease control. The public uses of the
    Refuge described in this report include interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about major maintenance,
    equipment replacement, communication systems, and computer systems. Items of interest
    are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
